import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import { Card, CardHeader, CardContent } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { RadioGroup, RadioGroupItem } from '@/components/ui/radio-group';
import { Label } from '@/components/ui/label';
import { Timer, CheckCircle2, XCircle } from 'lucide-react';

// Simulation de données de quiz
const sampleQuizData = {
  questions: [
    {
      id: 1,
      question: "Quelle est la définition de l'ISA (International Standard Atmosphere) au niveau de la mer ?",
      options: [
        "15°C, 1013.25 hPa, 1.225 kg/m³",
        "0°C, 1013.25 hPa, 1.225 kg/m³",
        "15°C, 1023.25 hPa, 1.225 kg/m³",
        "15°C, 1013.25 hPa, 1.325 kg/m³"
      ],
      correctAnswer: 0
    },
    {
      id: 2,
      question: "À quelle altitude la pression atmosphérique est-elle réduite de moitié par rapport au niveau de la mer ?",
      options: [
        "18,000 ft",
        "5,500 m",
        "7,000 m",
        "22,000 ft"
      ],
      correctAnswer: 1
    }
  ]
};

export default function QuizPage() {
  const { subject } = useParams();
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [selectedAnswer, setSelectedAnswer] = useState(null);
  const [showResult, setShowResult] = useState(false);
  const [score, setScore] = useState(0);

  const handleAnswerSelection = (answerIndex) => {
    setSelectedAnswer(answerIndex);
  };

  const handleNextQuestion = () => {
    if (selectedAnswer === sampleQuizData.questions[currentQuestion].correctAnswer) {
      setScore(score + 1);
    }

    if (currentQuestion < sampleQuizData.questions.length - 1) {
      setCurrentQuestion(currentQuestion + 1);
      setSelectedAnswer(null);
      setShowResult(false);
    } else {
      // Quiz terminé
      setShowResult(true);
    }
  };

  const currentQuestionData = sampleQuizData.questions[currentQuestion];

  if (showResult) {
    return (
      <div className="container mx-auto p-4">
        <Card className="max-w-2xl mx-auto">
          <CardHeader className="text-2xl font-bold text-center">
            Résultats du Quiz
          </CardHeader>
          <CardContent className="text-center">
            <p className="text-xl mb-4">
              Votre score : {score} sur {sampleQuizData.questions.length}
            </p>
            <Button onClick={() => window.location.reload()}>
              Recommencer le quiz
            </Button>
          </CardContent>
        </Card>
      </div>
    );
  }

  return (
    <div className="container mx-auto p-4">
      <Card className="max-w-2xl mx-auto">
        <CardHeader>
          <div className="flex justify-between items-center">
            <h2 className="text-xl font-semibold">Quiz : {subject}</h2>
            <div className="flex items-center">
              <Timer className="mr-2" />
              <span>Question {currentQuestion + 1}/{sampleQuizData.questions.length}</span>
            </div>
          </div>
        </CardHeader>
        <CardContent>
          <div className="mb-6">
            <h3 className="text-lg mb-4">{currentQuestionData.question}</h3>
            <RadioGroup 
              value={selectedAnswer} 
              onValueChange={(value) => handleAnswerSelection(parseInt(value))}
            >
              {currentQuestionData.options.map((option, index) => (
                <div key={index} className="flex items-center space-x-2 mb-2">
                  <RadioGroupItem value={index} id={`option-${index}`} />
                  <Label htmlFor={`option-${index}`}>{option}</Label>
                </div>
              ))}
            </RadioGroup>
          </div>
          <div className="flex justify-end">
            <Button 
              onClick={handleNextQuestion}
              disabled={selectedAnswer === null}
            >
              {currentQuestion === sampleQuizData.questions.length - 1 ? 'Terminer' : 'Suivant'}
            </Button>
          </div>
        </CardContent>
      </Card>
    </div>
  );
}
